Job Description

Vous êtes spécialiste du .NET et idéalement du CMS Sitefinity.
Le périmètre concerné intègre les environnements Web (Sites Internet et Intranet) et les applications mobiles.
Les technologies Microsoft sont majoritaires sur le périmètre : CMS Sitefinity, CMS Classic ASP, SQL Server, Environnements Azure, XAMARIN.

Compréhension des besoins et exigences du projet
Vous analysez les exigences de notre client;
Vous réunissez les spécifications et les exigences basées sur des besoins techniques
Codage ;
Vous mettez en œuvre la solution technique en fonction des normes de qualité et des engagements de l’équipe ;
Vous rédigez un code bien conçu, testable et évolutif en utilisant les technologies requises ;
Vous intégrez les données de divers services et bases de données back-end
Vous mettez au point une documentation technique détaillée au sujet des livrables du projet ;
Communication
Vous assistez à des réunions client/d’équipe durant le processus de développement ;
Vous communiquez tout progrès et/ou retard de manière efficace et précise ;
Vous adoptez une réflexion originale pour fournir une valeur de service élevée aux clients ;
Vous sensibilisez les collaborateurs aux technologies ou applications émergentes et aux opportunités de les intégrer aux opérations et aux activités.

Tests
Vous procédez à des tests de validation appropriés : tests unitaires, tests d’intégration, tests de validation exhaustifs, tests de performance.

Suivi de la technologie
Vous vous tenez informé(e) des toutes dernières tendances de l’industrie dans les technologies mobiles/web ;
Vous découvrez, évaluez et mettez en œuvre en permanence de nouvelles technologies en vue de maximiser l’efficacité du développement.

Qualifications

Compétences techniques
Junior : vous justifiez d’au moins 3 ans d’expériences confirmées dans une fonction de développement d’application web complexes (non centrées sur la conception web pure) ;
Senior : Vous justifiez d’au moins 6 ans d’expériences confirmées dans une fonction de développement d’application web complexes (non centrées sur la conception web pure) ;

Vous êtes expert(e) en technologies ASP .NET / MVC / Angular / Javascript
Vous avez idéalement une expérience dans le domaine des CMS (Sitefinity) ;
Vous êtes à l’aise avec la mesure de performance des applications webs, tests et indicateurs de résistance.

Compétences comportementales
Vous êtes organisé(e), vous savez jongler entre les tâches tout en respectant délais et budgets ;
Vous êtes dynamique, réactif(ve) et avez le sens de la situation ;
Vous avez un esprit d’analyse et êtes capable de comprendre rapidement des sujets complexes ;
Vous faites preuve de proactivité et vous savez travailler en équipe ;
Vous avez de bonnes aptitudes de communication.

Additional Information

Idweaver vous offre l’opportunité de participer à la croissance d’une agence de stratégie digitale en pleine expansion. Vous pourrez développer vos compétences en collaborant avec des experts de la communication et du web, dans un environnement dynamique, agile et convivial.
Nous ne travaillons pas pour nos clients, mais avec eux, sur des projets innovants et passionnants.

Nous recrutons 2 développeurs.

Le premier rôle est fait pour un développeur web Python rigoureux qui a déjà fait de la production et qui à un goût pour les bases de données. Il s'agit entre autre de tenir le système de gestion de droit de la plateforme aux côté d'un squad lead qui est lui aussi dev web Python.

Le deuxième rôle est un poste de développeur python et vous devrez être prêt à faire du XML dans des sockets avec du Python.

Missions du développeur Back-end Python :
Participation au développement backend des nouvelles fonctionnalités qui sont liés au produit final en python;

Produire des codes clairs en python et vérifier leurs bon fonctionnement

Être efficace et optimiser sa production ;

Mener à bien les projets des specs jusqu’à la production du code backend (en python)

Production de code ;

Comprendre son code et considérer ses implications dans le stockage et la base de donnée.

Profil recherché Profil du développeur Back-end Python :
Etre force de proposition ;

Savoir parler anglais ;

Très bien connaître le langage python ;

Avoir des connaissances sur : XMLRPC / REST API ;

Connaître EPP et DNS ;

Aimer travailler en équipe ;

Maîtriser l’intégration continue.
Entreprise Nous recrutons deux développeurs Back-end Python (H/F) dès que possible pour un client final basé à Paris. C'est un poste en CDI.

Description de l'entreprise
Agence pure player e-commerce crée en 2003, pionnière dans l'intégration SAAS E-commerce, nous accompagnons les marques et les distributeurs dans leur transformation durable au travers d'une offre "full services" combinant plateforme e-commerce, omnicanalité, data marketing, in-store et solutions d'engagement clients. Notre culture digitale façonne notre identifé et nos succès. Nous avons rejoint la famille Capgemini en 2017 avec pour objectifs d'accélérer notre croissance et d'apporter aux clients du groupe notre expertise e-commerce. ITELIOS à rejoint le palmares Great Place To Work depuis 2016 dans la catégorie des entreprises de moins de 500 salariés, et nous en sommes très fiers !
Description du poste
Rattaché(e) à un Chef de projet technico-fonctionnel, vous occupez le rôle de Technical Lead sur un projet pour un ou plusieurs comptes de la practice e-commerce et omnicanal de l'agence.
Au sein de l’équipe, (Salesforce Commerce B2C et B2B, Adobe Magento et solutions de Headless Commerce) déployées avec nos clients (forfait et assistance technique).
Vos missions principales consistent à :
Participer vous-même activement au développement de parties du programme, déployer les bonnes pratiques de développeur, résoudre les problèmes, faire monter en compétences tous les membres de l’équipe ;
Manager l’équipe, apporter support et conseils techniques à vos co-équipiers : vous vous assurez qu’ils comprennent parfaitement l’architecture qu’ils implémentent, qu’ils utilisent correctement les outils et environnements mis à leur disposition ;
Participer aux actions de formation des équipes de Développeurs en France et en Neashore au Maroc (déplacements ponctuels de 2 ou 3 jours) ;
Organiser périodiquement des activités type revue de code ou pair programming pour améliorer continuellement la performance collective ;
Définir les actions de refactoring, créer, consolider, maintenir la bibliothèque de composants ;
Garantir la tenue de charge de la plateforme et sa sécurité ;
Recueillir les exigences d’architectures que vous êtes chargé de mettre en œuvre dans votre équipe ;
Remonter du feedback à l'architecte sur les difficultés rencontrées ou les suggestions d’amélioration, et s’assurer du respect de la bonne progression des développements et des délais ;
Accompagner le Chef de projet technico-fonctionnel dans la relation client, le conseil et la mise en œuvre technique de votre expertise.
Les clients qui nous font confiance : GIVENCHY, KENZO, LACOSTE, SANDRO MAJE CLAUDIE PIERLOT, KERING, CHANEL, PIMKIE, JENNYFER, JULES, BRICE, UNDIZ…
Qualifications
BAC + 4/5 en Engineering, vous avez 4 ans d'expérience minimum dans le développement d'applications back end et front end incluant le management d’une équipe d’ingénieurs dans des contextes variés (domaine fonctionnel, technos, type de projet de plateformes digitales et/ou e-commerce). Si vous êtes full stack c’est un plus..
Vous êtes familier de ces technos :
Maîtrise de deux langages de développement parmi Java J2EE, .NET, PHP ou Nodejs ;
Maîtrise des standards HTML5 et CSS3 ;
Framework web : Langage JavaScript (ECMAScript6+) au travers des Framework JavaScript (Angular JS, React JS, Backbone..),
Automatisation de build : Maven, Gulp, Grunt.
Framework de déploiement applicatif : Connaissance de Jenkins, Travis CI, CircleCI ou Docker.
Interface de description du langage d’un web services : WADL, WSDL
Langage de commande : SSH, Bash, RDP, Powershell, CMD
Protocole de sécurité : SAML, SSO, OpenID Connect, Oauth
Bases de données : maîtrise d'une base de données relationnelles (SQL Server, Oracle, MySQL), ET orientée documents (MongoDB, ElasticSearch, CouchDB)
Framework de tests unitaires : Mocha, Jasmine.
Connaître l’administration serveur : Linux, Windows.
Vous vous maîtriser le chiffrage d’un projet et vous avez déjà compris les bienfaits de l’agilité (Scrum, Kanban…) dans votre métier.

Vous vous intéressez à toutes les facettes de votre métier d’ingénieur : architecture, conception, développement, méthodes, travail en équipe, enjeux business des projets auxquels vous participez.
Vous êtes avant tout un manager avec un focus technologique et vous n’envisagez pas un instant de lâcher le clavier ni l'encadrement d'équipes techniques.
Vous êtes continuellement en veille avec la curiosité comme moteur principal avec une forte sensibilité pour les challenges techniques et UI/UX de l’e-commerce.
Vous êtes anglais fluent (clients internationaux et équipes ITELIOS internationales).
Informations complémentaires
Process de recrutement en 3 étapes :
Présélection et entretien avec notre équipe Talent Acquisition ;
Passage d'un test technique sur le developpement web ;
Entretien avec un de nos Technical Leads.

Description de l'emploi
Acteur majeur du web international, cette société est aujourd'hui reconnu comme une référence dans son domaine. De dimension internationale, elle connait une croissance organique depuis son démarrage il y a plus de 15 ans.
Mon client est aujourd'hui à la recherche d'un lead développeur python.
Présentation :
Tu participes aux développements de nouvelles fonctionnalités liées aux produits, en étroite collaboration avec des développeurs Front End et des membres de l’équipe UX/UI, au sein d'une équipe en mode agile
Missions :
Tu produis un code clair, robuste et réutilisable par les autres ;
Tu sais optimiser ta production en termes de fluidité et de rapidité d'usage ;
Tu es soucieux de la sécurité des usagers et de la protection de leurs données ;
Tu es en capacité d'identifier et de prendre en considération les implications de ton code en matière de stockage d'informations et de bases de données ;
Tu participes aux évolutions de la stack en étant force de proposition ;
Tu relèves les challenges de dev en équipe.
Tes atouts :
Tu jongles entre l'anglais, le français et le python ;
Tu es ouvert, empathique et sais travailler en équipe y compris avec des non développeurs ;
Tu as des connaissances en DNS, Jenkins, GIT, les intégrations continues, le déploiement et les tests, les base de données…
Tu as des dispositions en API REST, tests unitaires, review de code, Django, Pyramid, SqlAchemy, Celery…
Des notions en hébergement peuvent être intéressantes !

Vous souhaitez parfaire vos connaissances en frontend, être formé.e et relever un nouveau défi ?
Embarquement immédiat pour un projet de refonte intégrale d’une boutique en ligne dans le secteur des media, en plein cur de Paris.

Au sein d’une équipe de 8 personnes dont 4 développeurs, vous apporterez votre expertise et votre détermination pour participer au développement d’un projet à grande visibilité et à fort trafic.

Quelques exemples des tâches qui composeront votre mission :
Réflexion autour de l’architecture technique ;
Conception des développements en front-end ;
Développement des fonctionnalités métiers ;
Refactoring de code (qui est très challengeant !) ;
Interaction avec différents web services ;
Coordination avec les groupes de travail côté back-end.

Contexte du projet :
Respect des bonnes pratiques du développement conformément à l’approche clean code !
Principes de l’agilité avec fonctionnement en cycle court : sprint de 2 semaines avec réunions de début et de fin de sprint.

PROFIL :
Fan de frontend, de software craftsmanship et d’agilité ? Vous aimeriez explorer les nouvelles technologies Javascript et vous tenir au courant des nouvelles sorties (Angular, ReactJS) ?
Diplômé.e d’une école d’Ingénieur ou équivalent, vous possédez déjà un solide socle technique et vous êtes sensible aux technologies du web.

POURQUOI Nous rejoindre ?

Un parcours de formation sur mesure : tutorat et coaching, dojos et accompagnement à l’obtention de certifications ;
Un team de développeurs soudés et choisis parmi les meilleurs passionnés ;
Un environnement 100 agile basé sur les bonnes pratiques Scrum, DevOps et Lean ;
Du fun et de la proximité pendant nos deux soirées par mois (Escape game, bars, jeux de rôle, karting, jeux vidéo ) et des meetups internes mensuels.

Au sein de l’équipe technique digitale présente à Paris, vous participerez à de nombreux projets sur les domaines du site e-commerce et de l’application digitale en magasin. Vous aurez ainsi l’opportunité de vous inscrire dans une transformation technique des plates-formes digitales utilisées, dans le contexte d'un groupe en forte croissance (http://www.zonebourse.com/MAISONS-DU-MONDE-27862556/actualite/MAISONS-DU-MONDE-RESULTATS-DU-PREMIER-SEMESTRE-2017-24833718/).
Il y actuellement 6 équipes agiles, constituées de lead-dev, dev back, dev front, QA, scrum master et product owner.

Votre contribution ? En tant que Développeur Front End confirmé, vous êtes intégré dans l'une de nos équipes travaillant selon les méthodologies Agile (Scrum) et vous participerez aux différents développements de l’équipe.
Vous serez également force de proposition et de prototypage de diverses utilisations des technologies front end.
Outre les compétences techniques en JS, le poste demande de la créativité et de l’expérience dans le domaine de l’expérience utilisateur (sensibilité graphique, ergonomie, etc...).

Poste en CDI basé à Paris, proche de la gare St Lazare.

Pour ce poste nous recherchons un candidat avec :
Une expérience de développement front end JS ;
Des connaissances avancées dans l'un des frameworks suivants : React.js, Angular, VueJS ;
Une capacité à apporter des évolutions techniques, une bonne maîtrise de la délimitation entre la structure, la présentation et le comportement de l’interface ;
De très bonnes connaissances de la stack front end (html5, css3, ES6) ;
Une capacité à délivrer une belle expérience (mobile first & cross-browsers) ;
De l'expérience avec les outils de bundling (webpack, gulp) ;
Une maitrise des techniques d'optimisation de performances coté client ;
Une expérience de projet avec des feature-teams ;
Une capacité à promouvoir les bonnes pratiques auprès d’une audience élargie ;
De la créativité et de l'expérience dans le domaine de l’expérience utilisateur ;
De bonnes connaissances du Web en général souhaitée ;
Un anglais courant à l'écrit et l'oral est un plus.
Vous avez un goût prononcé pour la veille technologique et aimez recourir aux techniques de pointe les plus récentes.
Vous avez le sens de la communication et appréciez travailler en équipe.
Vous êtes autonome.
Vous travaillez de manière rigoureuse et sérieuse dans la bonne humeur.
Vous êtes sensible à la qualité du produit et avez une compréhension des enjeux business.

Description de l'emploi
Nous recherchons un Développeur Web Lead Front-End qui est motivé à combiner l'art du design avec l'art de la programmation. Les responsabilités incluront la traduction des images filaires de conception UI/UX en code réel qui produira des éléments visuels de l'application Web. Vous travaillerez avec le concepteur UI/UX et comblerez le fossé entre la conception graphique et l'implémentation technique, en jouant un rôle actif des deux côtés et en définissant l'apparence et le fonctionnement de l'application.
Vos responsabilités :
Développer de nouvelles fonctionnalités pour les utilisateurs ;
Créez du code et des bibliothèques réutilisables pour une utilisation future ;
Assurer la faisabilité technique des conceptions UI/UX ;
Optimiser l'application pour une vitesse et une évolutivité maximales ;
S'assurer que toutes les entrées des utilisateurs sont validées avant de les soumettre au back-end ;
Collaborer avec les autres membres de l'équipe et les intervenants.
Ce que nous recherchons
CE DONT VOUS AUREZ BESOIN
Fortes connaissances en HTML/CSS, javascript, jQuery, Bootstrap, Gulp, Webpack, Bower ;
Photoshop et Illustrator ;
La connaissance de React serait un plus ;
Quelqu'un d'amusant, d'ambitieux et d'humble.
OUR STACK
Front : HTML/CSS, javascript, jQuery, jQuery, bootstrap
Retour : PHP, Symfony, MySQL, Doctrine, ElasticSearch.
Nous utilisons JIRA
Infra : AWS, Docker, Docker
Traduit avec www.DeepL.com/Translator

