Poste
Pour un de nos clients Parisien nous recherchons un profil Lead Ingénieur(e) QA. Votre job sera de garantir la qualité des développements en mettant en place une stratégie de tests automatisés de haut niveau sur les différents environnements (prod, pré-prod, staging…).

Vous serez le 1er profil automaticien à intégrer l’équipe. Il y aura tout à faire et à mettre en place. Vous travaillerez en étroite collaboration avec le CTO et vous serez amenés à challenger, éduquer, évangéliser auprès des PO et des développeurs.

Votre objectif :
Permettre aux PO de lancer des tests End-To-End efficaces et personnalisés sur les différentes applications sans toucher aux codes.

Vos missions :
Vous auditez le fonctionnement de l’entreprise et plus particulièrement de l’équipe dev et vous proposez une stratégie de tests automatisés complète ;
Vous préconisez les outils de tests, vous les installez et vous en assurez la maintenance ;
Vous intégrez l’environnement de tests automatisés à l’environnement d’intégration continue ;
Vous rédigez/complétez/adaptez les cas de tests pour l’automatisation ;
Vous structurez votre code sous forme de bibliothèques de code réutilisables ;
Vous développez et maintenez les tests de non-régression ;
Vous qualifiez les anomalies et partagez les rapports des campagnes de tests ;
Vous évangéliserez les développeurs aux bonnes pratiques pour des scripts robustes ;
Profil
Vous avez une solide expérience en automatisation et au moins une première expérience en Test Lead automatisation ;
Vous maitrisez Selenium, Appium, SOAP UI… ou tout autre outil open source que vous saurez défendre ;
Vous avez une première expérience sur Appium ;
Vous développez aussi bien en Java qu’en JS ;
Vous êtes capable de comprendre un SI complexe intégrant plusieurs back et front développés sur des technos différentes (API, Sites web, Applications mobiles, Back-office métier…)
Vous êtes autonome et vous savez challenger les développeurs ;
Vous avez un très bon relationnel et souhaitez travailler dans un environnement challengeant en ayant des responsabilités ;
Vous maitrisez l’anglais technique.

CDI
Compétences
Automatisation, autonomie, pédagogie, excellent relationnel.
Expérience
2 à 3 ans
Localisation
127 Avenue Charles de Gaulle 92521 Neuilly-Sur-Seine

